script: |
  super -f text -I q12655.spq | sort > q12655.out

inputs:
  - name: q12655.spq
    data: |
      SELECT ALL + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE 32 + - ( + + col0 ) - + - 15 NOT BETWEEN + 34 + + - col1 AND + col0;
  - name: tab1

outputs:
  - name: q12655.out
    data: |
      14
      47
      5
